import React from "react";
import "./index.css";

export default function Menu() {
  return (
    <div className="menu">
      <Categorie subtitle="Electronique" />
      <Categorie subtitle="Homme" />
      <Categorie subtitle="Femme" />
      <Categorie subtitle="Enfant" />
    </div>
  );
}

export const Categorie = ({ subtitle }) => {
  return (
    <div className="categorie">
      <a href="Man">{subtitle}</a>
    </div>
  );
};
